import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Navigation, Footer, Home, Login } from "./components/index";


import './App.css';
class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};

    }
    render() {
        return (
            <div className="App">
                <Router>
                    <Navigation />
                    <Switch>
                        <Route path="/" exact component={() => <Home />} />
                        <div className="login">
                        <Route path="/signup" exact component={() => <Login />} />
                        </div>
                    </Switch>
                    <Footer />
                </Router>
            </div>
        )
    }

}

export default App;
